import './App.css';
import React from 'react';
import Expenses from './components/Expenses/Expenses';
import FilterByYear from './components/Expenses/FilterByYear';
import NewExpense from './components/NewExpense/NewExpense';
import ExpensesFilter from './components/ExpenseFilter/ExpensesFilter';
const expenses = [
  {
    date: '2020-08-14',
    name: 'Toilet Paper',
    price: 94.12
  },
  {
    date: '2020-03-12',
    name: 'New TV',
    price: 799.49
  },
  {
    date: '2021-03-28',
    name: 'Car Insurance',
    price: 294.67
  },
  {
    date: '2022-06-12',
    name: 'New Desk(Wooden)',
    price: 450
  }
];
const years = [
  2020,
  2021,
  2022
];
function App() {
  function saveExpenseData(enteredData) {
    const expenseData = {
      ...enteredData
    }
    expenses.push(expenseData);
  }
  return (
    <div>
      <NewExpense onSaveExpense={saveExpenseData} />
      <ExpensesFilter years={years} />
      <Expenses expenses={expenses} />
    </div >
  );
}

export default App;
